function generateString($length = 4) { 
	$characters = array_merge(range('0','9'),range('a','f'));

 	$string = '';
	for ($i = 0; $i < $length; $i++) {
		$string .= $characters[rand(0, count($characters) - 1)];
	}

	return $string;
}

